export default {
  printWidth: 100,
  trailingComma: "es5",
  plugins: ["prettier-plugin-sh"],
};

import globals from "globals";
import js from "@eslint/js";
import pluginVue from "eslint-plugin-vue";
import vueTsEslintConfig from "@vue/eslint-config-typescript";
import skipFormattingConfig from "@vue/eslint-config-prettier/skip-formatting";

export default [
	js.configs.recommended,
	...pluginVue.configs["flat/recommended"],
	...vueTsEslintConfig(),
	skipFormattingConfig,
	{
		languageOptions: {
			globals: {
				...globals.browser,
				...globals.node,
			},

			ecmaVersion: "latest",
			sourceType: "module",
		},

		rules: {
			"vue/require-default-prop": "off",
			"vue/attribute-hyphenation": "off",
			"vue/multi-word-component-names": "off",
			"vue/no-reserved-component-names": "off",
			/*"vue/no-undef-properties": "warn",*/
			"no-param-reassign": "error",
			"vue/block-lang": "off",
		},
	},
];

import { defineConfig } from "histoire";
import { HstVue } from "@histoire/plugin-vue";

export default defineConfig({
  plugins: [HstVue()],
  setupFile: "./histoire.setup.js",
  viteNodeInlineDeps: [/!axios/, /shopicons/],
  routerMode: "hash",
  backgroundPresets: [
    {
      label: "default",
      color: "var(--evcc-background)",
      contrastColor: "var(--evcc-default-text)",
    },
    {
      label: "box",
      color: "var(--evcc-box)",
      contrastColor: "var(--evcc-default-text)",
    },
  ],
});

export default {
  preset: "@vue/cli-plugin-unit-jest/presets/no-babel",
  testMatch: ["**/*.spec.js"],
};

package main

import (
	"embed"
	"io"
	"io/fs"
	"log"

	"github.com/evcc-io/evcc/cmd"
	"github.com/evcc-io/evcc/server/assets"
	_ "golang.org/x/crypto/x509roots/fallback" // fallback certificates
)

var (
	//go:embed dist
	web embed.FS

	//go:embed i18n/*.toml
	i18n embed.FS
)

// init loads embedded assets unless live assets are already loaded
func init() {
	if !assets.Live() {
		var err error

		assets.Web, err = fs.Sub(web, "dist")
		if err != nil {
			panic(err)
		}

		assets.I18n, err = fs.Sub(i18n, "i18n")
		if err != nil {
			panic(err)
		}
	}
}

func main() {
	// suppress deprecated: golang.org/x/oauth2: Transport.CancelRequest no longer does anything; use contexts
	// see https://github.com/golang/oauth2/issues/487
	log.SetOutput(io.Discard)

	cmd.Execute()
}

